import React from 'react';
import { NavLink } from 'react-router-dom';
import Result from '../pages/Result';
import Ajout from '../pages/Ajout';
const Navigation = () => {
    return (
        <div className="p-2 col-2 border border-primary rounded" >
                    
        <br /><br />
        <NavLink to="/Ajout"><button type="button" className="btn btn-outline-primary">Ajout de these</button>  </NavLink>
        <br /> <br />
        <NavLink to="/Result"><button type="button" className="btn btn-outline-primary">Gestion des theses</button>  </NavLink>
        <br /><br />
        <NavLink to="/Detail"><button type="button" className="btn btn-outline-primary">Gestion des Utilisateurs</button>  </NavLink>
        <br /><br />
        <NavLink to="/"> <button type="button" className="btn btn-outline-primary">Statistiques</button>  </NavLink>

        </div>
        
    );
};

export default Navigation;
